import { ThemeOptions } from '@mui/material/styles';

export const themeOptions= {
  palette: {
    mode: 'light',
    primary: {
      main: '#fafbfb',
    },
    secondary: {
      main: '#757575',
    },
    background: {
      paper: '#F2E3D5',
      default: '#D9CBBF',
    },
  },
  spacing: 8
};
